import React, { Component } from 'react';
import './App.css';





class App extends Component {








  render(){
    let color , dis ;

    color = {
      color:"blue",
    }

    dis={
      display:"none"
    }

    return(


     <div style={color} onClick ={this.cclick}>
       hello react page
       <div style={dis}>
         hello you 
       </div>
     </div>
    );
  }
}

export default App;
